script: |
  super -f text -I q6150.spq | sort > q6150.out

inputs:
  - name: q6150.spq
    data: |
      SELECT DISTINCT - - 67 AS col1 FROM tab2 (FORMAT parquet) WHERE ( + col1 / + + 68 * + CAST ( + - col2 AS REAL ) ) BETWEEN 56 * + col1 + col2 AND - + col0;
  - name: tab2

outputs:
  - name: q6150.out
    data: |
